    return (
        <div className={'mt-5'}>

            <Button onClick={()=>{setState(!state);
                console.log(state)}} variant={'dark'}>Создать!</Button>
            {state?
                <div onClick={()=>{setState(!state)}}>
                    <ModalToCreate onClick={()=>setState}/>
                </div>
                :
            <div></div>
            }
        </div>
    );
});

export default ModalState;
